var lookupCouncilHastings = async (postcode, number) => {
  console.log(`Hastings council looking up house number: ${number} for postcode: ${postcode}`)

  var jar = rp.jar()

  console.log('Fetching new session cookie and ASP viewState')
  var viewStateData = await rp({
    url: 'https://www.hastings.gov.uk/waste_recycling/lookup/',
    jar: jar,
    transform: function (body) {
      return cheerio.load(body)
    }
  })
  var viewState = viewStateData('#__VIEWSTATE').val()
  var viewStateGenerator = viewStateData('#__VIEWSTATEGENERATOR').val()
  var eventValidation = viewStateData('#__EVENTVALIDATION').val()

  console.log('Fetching bin dates')
  var binResultData = await rp({
    method: 'POST',
    url: 'https://www.hastings.gov.uk/waste_recycling/lookup/',
    jar: jar,
    form: {
      __EVENTTARGET: '',
      __EVENTARGUMENT: '',
      __VIEWSTATE: viewState,
      __VIEWSTATEGENERATOR: viewStateGenerator,
      __EVENTVALIDATION: eventValidation,
      ctl00$leftCol$postcode: postcode,
      ctl00$leftCol$propertyNum: number,
      ctl00$leftCol$ctl05: 'Find Address'
    },
    transform: function (body) {
      return cheerio.load(body)
    }
  })

  var binResults = []

  var recyclingBinDataRaw = binResultData('#Recycling').html().trim().split('<br>')
  recyclingBinDataRaw.forEach((recyclingBinDataRaw) => {
    var binDate = recyclingBinDataRaw.trim()
    if (binDate) {
      console.log(binDate)
      var bin = {
        type: 'recycling',
        date: moment(binDate, 'dddd DD MMM YYYY').format()
      }
      bin.dateHuman = moment(bin.date).format('dddd Do MMMM YYYY')
      binResults.push(bin)
    }
  })

  var rubbishBinDataRaw = binResultData('#Rubbish').html().trim().split('<br>')
  rubbishBinDataRaw.forEach((rubbishBinDataRaw) => {
    var binDate = rubbishBinDataRaw.trim()
    if (binDate) {
      console.log(binDate)
      var bin = {
        type: 'rubbish',
        date: moment(binDate, 'dddd DD MMM YYYY').format()
      }
      bin.dateHuman = moment(bin.date).format('dddd Do MMMM YYYY')
      binResults.push(bin)
    }
  })

  console.log(binResults)

  return {
    status: true,
    council: 'Hastings Council',
    reasonUser: `Here's the next ${binResults.length} bin collections for you`,
    binResults: binResults
  }
}

const lookupCouncilDerbyCityCouncil = require('./councils/DerbyCityCouncil');

var lookupPostcode = async (number, postcode) => {
//  var postcode=request.postcode;
//  var number=request.number;

  var apiResult
  var postcodeResult
  try {
    postcodeResult = await rp({ url: `http://api.postcodes.io/postcodes/${postcode}`, json: true })
  } catch (errorResult) {
    console.log(errorResult)
    postcodeResult = errorResult.response.body
  }
  if (postcodeResult.status === 200) {
    console.log(postcodeResult)
    var council = postcodeResult.result.admin_district
    console.log(`Found council: ${council}`)
    switch (council) {
      case 'Derby':
        console.log('Derby city council detected')
        apiResult = await lookupCouncilDerbyCityCouncil(postcode, number)
        break
      case 'Hastings':
        console.log('Hastings council detected')
        apiResult = await lookupCouncilHastings(postcode, number)
        break
      case 'Bournemouth, Christchurch and Poole':
        console.log('Bournemouth, Christchurch and Poole (BCP) detected')
        apiResult = await lookupCouncilBCP(postcode, number)
        break
      case 'Nottingham':
        console.log('Nottingham City Council detected')
        apiResult = await lookupCouncilNottinghamCityCouncil(postcode, number)
        break
      default:
        apiResult = {
          status: false,
          reasonUser: `Sorry, we don't currently support your council (${council}), please let us know so we can add support!`
        }
    }
  } else {
    console.log(`Failed looking up postcode: ${postcode}`)
    console.log(postcodeResult)
    apiResult = {
      status: false,
      reasonUser: `An error occured looking up the council for postcode: ${postcode}, ${postcodeResult.error}`
    }
  }
  if (apiResult.status) {
    apiResult.binResults = apiResult.binResults.sort((a, b) => {
      if (moment(a.date) > moment(b.date)) {
        return 1
      }
      if (moment(b.date) < moment(a.date)) {
        return -1
      }
      return 0
    })

    apiResult.nextCollection = {}
    apiResult.binResults.forEach((binResult) => {
      if (!apiResult.nextCollection[binResult.type]) {
        apiResult.nextCollection[binResult.type] = binResult
      }
    })
  }

  console.log(apiResult)
  return apiResult
}

