var lookupCouncil = async (postcode) => {
  var apiResult
  var postcodeResult

  try {
    postcodeResult = await rp({ url: `http://api.postcodes.io/postcodes/${postcode}`, json: true })
  } catch (errorResult) {
    console.log(errorResult)
    postcodeResult = errorResult.response.body
  }
  if (postcodeResult.status === 200) {
    console.log(postcodeResult)
    var council = postcodeResult.result.admin_district
    var councilName = council
    var foundCouncil = false

    console.log(`Found council: ${council}`)
    switch (council) {
      case 'Derby':
        console.log('Derby city council detected')
        councilName = 'Derby City Council'
        foundCouncil = true
        break
      case 'Hastings':
        console.log('Hastings council detected')
        councilName = 'Hastings Council'
        foundCouncil = true
        break
      case 'Nottingham':
        console.log('Nottingham City Council detected')
        councilName = 'Nottingham City Council Council'
        foundCouncil = true
        break
      case 'Bournemouth, Christchurch and Poole':
        console.log('Bournemouth, Christchurch and Poole (BCP) detected')
        councilName = 'Bournemouth, Christchurch and Poole (BCP) Council'
        foundCouncil = true
        break
      default:
        apiResult = {
          status: false,
          reasonUser: `Sorry, we don't currently support your council (${council}), please let us know so we can add support!`,
          council: council
        }
    }

    if (foundCouncil) {
      apiResult = {
        status: true,
        reasonUser: `Council for postcode: ${postcode} is ${council}`,
        council: council,
        councilName: councilName
      }
    }
  } else {
    console.log(`Failed looking up postcode: ${postcode}`)
    console.log(postcodeResult)
    apiResult = {
      status: false,
      reasonUser: `An error occured looking up the council for postcode: ${postcode}, ${postcodeResult.error}`
    }
  }

  console.log(apiResult)
  return apiResult
}

exports.lookupAddress = functions.https.onRequest(async (req, res) => {
  console.log(req.query)
  try {
    var apiResult
    var postcode = req.query.postcode
    var number = req.query.number
    if (req.query.council) {
      var council = req.query.council
      switch (council) {
        case 'Derby':
          console.log('Forcing request to Derby City council')
          apiResult = await lookupCouncilDerbyCityCouncil(postcode, number)
          break
        case 'Bournemouth, Christchurch and Poole':
          console.log('Bournemouth, Christchurch and Poole (BCP) detected')
          apiResult = await lookupCouncilBCP(postcode, number)
          break
        case 'BCP (Christchurch)':
        case 'BCP (Bournemouth)':
          console.log('BCP (Christchurch/Bournemouth) detected')
          apiResult = await lookupCouncilBCPBournemouthChristchurch(postcode, number)
          break
        default:
          console.log(`Unknown council: ${council}`)
          apiResult = {
            status: false,
            reasonUser: `Sorry, we don't currently support your council (${council}), please check the name and if correct let us know so we can add support!`
          }
      }
    } else {
      apiResult = await lookupPostcode(number, postcode)
    }

    var format = 'JSON'
    if (req.query.format) {
      format = req.query.format
    }

    switch (format) {
      case 'JSON':
        console.log('JSON')
        res.send(apiResult)
        break
      case 'ICAL':
        console.log('ICAL')
        var cal = ical({
          domain: 'bindayapi.web.app',
          prodId: { company: 'okonetwork.org.uk', product: 'bindayapi' },
          name: `Bin day calendar for ${number} ${postcode} (${apiResult.council})`,
          timezone: 'Europe/Berlin'
        })

        apiResult.binResults.forEach((binResult) => {
          var binSummary
          if (binResult.color) {
            binSummary = `${binResult.color} bin due out`
          } else {
            binSummary = `${binResult.type} bin due out`
          }
          cal.createEvent({
            start: moment(binResult.date),
            end: moment(binResult.date),
            timestamp: moment(binResult.date),
            summary: binSummary,
            organizer: 'Bin Days API <support@bindays.web.app>'
          })
        })

        res.send(cal.toString())
        break
      default:
        console.log(`Unknown format: ${format} requested`)
        res.send({
          status: false,
          reasonUser: `Unknown format: ${format} requested`
        })
    }
  } catch (errorResult) {
    console.log('Error occured')
    console.log(errorResult)
    res.send({
      status: false,
      reasonUser: 'Something went wrong, please report this to the bin days api team'
    })
  }
})
